import React from 'react';
const Filter = ({items}) => {
	const itemsRender = items.map((item) => {
		return (
			<button onClick={() => item.action} type="button" className="btn btn-sm btn-outline-info border-0 m-0  list">
				<i className="material-icons">filter_alt</i>
			</button>
		);
	});
	return <div class="d-flex flex-row-reverse align-items-start">{itemsRender}</div>;
};

export default Filter;
